import React, { useState, useContext } from 'react';
import { Authorize } from "../../../MainComponents/DesktopComponent";


const UserDashboard = () => {

    const setAuth = useContext(Authorize);
    const [TX_USER_NAME, setTX_USER_NAME] = useState("");

    async function getName() {
        try {
            const body = { TX_USER_NAME, TX_USER_EMAIL, TX_USER_PASSWORD };
            const response = await fetch("http://localhost:5000/dashboard/", {
                method: "GET",
                headers: { token: localStorage.jwtToken },
                body: JSON.stringify(body)
            });

            const parseRes = await response.json()
            localStorage.setItem("jwtToken", parseRes.jwtToken)
            setAuth(true);

        } catch (error) {
            console.log(error.message);
        }
    }

    return (
        <>
            HELLO DASHBOARD
            <button onClick={() => setAuth(false)}>Logout</button>
        </>
    )
}

export default UserDashboard;
